import React from 'react';
import './CV.css';

export default function Ailly() {
    return (
        <>
        <div className="zero_point_five_cm_vertical_space"/>
        <div className="row">
            <h3 className="Ailly_h3">PCSI (Physics, Chemistry and Engineering Sciences), Major. <br/>
                PC (Physics, Chemistry): 3rd in class.
            </h3>
        </div>
        <div className="zero_point_five_cm_vertical_space"/>
        <p className="fifteen_px_mobile_text" style={{textAlign: "center"}}>Two years of intensive work in order to be able to pass the entrance 
        exams to engineering schools.</p>
        <div className="zero_point_five_cm_vertical_space"/>
        </>
    )
}
